 Here is one way to sort a dictionary by keys in ascending order in JavaScript:
```javascript
const dict = {
  b: 1,
  d: 3,
  a: 2,
  c: 4
};

// Convert the object to an array of key-value pairs.
const sortedArray = Object.entries(dict).sort((a,b) => a[0].localeCompare(b[0]));

// Map the key-value pairs back to a dictionary format.
const sortedDict = Object.fromEntries(sortedArray);

console.log(sortedDict); // Output: { a: 2, b: 1, c: 4, d: 3 }
```
In this code, `Object.entries()` is used to convert the dictionary (object) into an array of key-value pairs. Then, `sort()` is called on that array with a custom comparator function that compares keys based on their string representation using `localeCompare()`. Finally, we use `Object.fromEntries()` to map the sorted key-value pairs back to a dictionary format.
